import React,{useEffect} from 'react'

const Student = (props) => {

    useEffect(()=>{
        alert('The Count Is :'+props.count)
        alert('The Count Is :'+props.data)
        },[props.count][props.data])
        

    return (
        <div>
        <h1>Count Props : {props.count}</h1>
        <h1>Data Props : {props.data}</h1>
        
        </div>
    )
}

export default Student
